    function getCoordsForArrow() {
        var rB = this.RemainingBalls.length;
        if (rB < 3) rB++;
        var nextBallNumber = this.NextBalls[this.NextBalls.length - rB];//this.NextBalls[1];
        var coords = {};

        for(var i = 0, j = this.FieldBalls.length; i < j; i += 1) {
            for(var k = 0, l = this.FieldBalls[i].length; k < l; k += 1) {
                if(nextBallNumber == this.FieldBalls[i][k]) {
                    coords.x = i;
                    coords.y = k;
                    coords.num = nextBallNumber;
                }
            }
        }

        return coords;
    }

